import React from 'react'

function Footer() {
  return (
    <div className='d-flex flex-coumn min-vh-100'>
        <footer class="p-1 bg-dark text-white text-center  mt-auto">
            <div class="container-fluid">
                <p class="lead">Copyright &copy; mcs</p>
            </div>
        </footer>
    </div>
  )
}

export default Footer
